import React from 'react';
import {Grid} from '@material-ui/core';
import randomColor from 'randomcolor';

const RepoPage = () => {
  return (
    <div  className="RepoPage_GridA1">
    <Grid container xs={4} spacing={2} direction="column">
      <div style={{background:randomColor()}}>
          Authorisation
      </div>
      <Grid item xs={10}>
        <div style={{background:randomColor()}}>Hooray something is here!</div>
      </Grid>
      <Grid item xs={10}>
        <div style={{background:randomColor()}}> Hooray something is too! </div>
      </Grid>
      <Grid item xs={10}>
        <div style={{background:randomColor()}}> Another item! </div>
      </Grid>
      <Grid item xs={10}>
        <div style={{background:randomColor()}}> Showing off rows! </div>
      </Grid>
      <Grid item xs={10}>
        <div style={{background:randomColor()}}> Last item! </div>
      </Grid>
    </Grid>
  </div>
);
};
    
    
    
    
    
    
    
